    "Cockpit is perfect for new sysadmins, allowing them to easily perform simple tasks such as storage administration, inspecting journals and starting and stopping services. You can monitor and administer several servers at the same time. Just add them with a single click and your machines will look after its buddies.": [ null, "Cockpit — чудовий інструмент для системних адміністраторів-початківців. За його допомогою вони без проблем впораються із простими завданнями, зокрема адмініструванням сховищ даних, інспектуванням журналів та запуском і зупиненням служб. Ви зможете одночасно стежити за роботою декількох серверів і адмініструвати ці сервери. Просто додайте їх одним клацанням кнопкою миші і ваш комп’ютер сам нагляне за своїми приятелями." ],
    "Cockpit was unable to contact {{#strong}}{{host}}{{/strong}}.": [ null, "Cockpit не вдалося встановити зв’язок ізt {{#strong}}{{host}}{{/strong}}." ],
    "Cockpit was unable to log in to {{#strong}}{{host}}{{/strong}}. {{#can_sync}}You may want to try to {{#sync_link}}synchronize users{{/sync_link}}.{{/can_sync}} For more authentication options and troubleshooting support please upgrade cockpit-ws to a newer version.": [ null, "Cockpit не вдалося увійти до {{#strong}}{{host}}{{/strong}}. {{#can_sync}}Вам варто спробувати {{#sync_link}}синхронізувати користувачів{{/sync_link}}.{{/can_sync}} Щоб отримати доступ до ширшого спектра способів розпізнавання та до підтримки діагностики помилок, будь ласка, оновіть cockpit-ws." ],
    "Cockpit was unable to log into {{#strong}}{{host}}{{/strong}}.": [ null, "Cockpit не вдалося увійти до {{#strong}}{{host}}{{/strong}}." ],
    "Cockpit was unable to log into {{#strong}}{{host}}{{/strong}}. To use this machine with cockpit you will need to enable one of the following authentication methods in the sshd config on {{#strong}}{{host}}{{/strong}}:": [ null, "Cockpit не вдалося увійти до {{#strong}}{{host}}{{/strong}}. Щоб користуватися цим комп’ютером за допомогою cockpit, вам слід увімкнути вказані нижче способи розпізнавання у налаштуваннях sshd на {{#strong}}{{host}}{{/strong}}:" ],
    "Cockpit was unable to log into {{#strong}}{{host}}{{/strong}}. You can change your authentication credentials below. {{#can_sync}}You may prefer to {{#sync_link}}synchronize accounts and passwords{{/sync_link}}.{{/can_sync}}": [ null, "Cockpit не вдалося увійти до {{#strong}}{{host}}{{/strong}}. Ви можете змінити ваші реєстраційні дані для розпізнавання нижче. {{#can_sync}}Можливо, варто надати перевагу {{#sync_link}}синхронізації облікових записів і паролів{{/sync_link}}.{{/can_sync}}" ],
